import React from 'react'

export default function RegisterForm() {
  return (
    <form >
        <h2>Login to Tremplin-OC</h2>
        <p>Enter your details below</p>
        <input type="text" placeholder='User ID' />
        <input type="text" placeholder='Password' />
    </form>
  )
}
